const Modal = ({state}) => {
  return (
    <div class={`modal ${state && 'is-active'}`}>
      <div class="modal-background"></div>
      <div class="modal-content">tezrfsdf</div>
      <button class="modal-close is-large" aria-label="close"></button>
    </div>
  );
};

export default Modal;
